description:
The tire company Pirelli releases an exclusive calendar every year.

These are all of the Pirelli Calendar Pics from 1964-2012.

They didn't make a calendar in the years: 1967 and from 1975-1983.

They features many models and celebrities. Sometimes nude, sometimes not.

759 pics.


